import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    Botao: {
      marginTop: 50,
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: '#17A558',
      width: 250,
      height: 50,
      left: 50,
      borderRadius: 50
    },
    Textocadas: {
      fontSize:25,
      alignItems: 'center',
      justifyContent: 'center',
      left: 20,
      marginTop: 105
    },
    Inputs: {
      height: 45,
      borderWidth: 1,
      borderColor: '#B1D3C1',
      marginLeft: 10,
      marginRight: 20,
      marginTop: 5,
      borderRadius: 15,
      backgroundColor: '#B1D3C1',
      padding: 3
    },
    botaofazerlogin: {
      marginTop: 10,
      alignItems: 'center',
      justifyContent: 'center',
      width: 250,
      height: 50,
      left: 50
    },
    Error: {
      alignSelf: 'flex-start',
      color: '#ff375b',
      marginBottom: 8,
      left: 30
    }
  })

  export default styles;
